import "./Contact.css";
import Support from "./Support";
import Home from "./Home";

import surgery2 from "./images1/surgery2.jpg";

const Contact = () => {
  return (
    <div className="about">
      <div className="abtell">
        Phone : +25471111112 <br></br>
        Customer support:<br></br>
        Email : support@doctorsapp.com<br></br>
        Official queries:<br></br>
        info@doctorsapp.com
      </div>
<div className="surgery2">
<img src={surgery2} alt=" surgery doctors" />
</div>

      </div>
      );
};
export default Contact;
